9 KjøpEn flott faktafortelling om en fascinerende øyestikker. Vi føres tett på vår største øyenstikker, for å bli kjent med livet den lever i norsk natur. Visste du at kongeøyenstikkeren er et rovdyr, mer effektiv enn hvithaien? - Kysten – flora og fauna kr 279 KjøpCappelens naturhåndbøker, 2. utgave. Kystens flora og fauna er mangfoldig i vårt langstrakte land. Kysten – flora og fauna beskriver de vanligste artene – alger, lav, blomster, trær, vekster, virvelløse dyr, fisker fugler og pattedyr;

